import React from 'react';
// boootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
// helmet
import {Helmet} from 'react-helmet';

// components
import './App.css';



<Helmet>
<meta charSet="utf-8" />
<title>Tony River'a Full-Stack</title>
<link rel="canonical" href="/" />
<meta name="description" content="Tony River'a Full-Stack" />
</Helmet>

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Home, Nav, About, Projects, Contact, Footer } from "./Components";



function App() {
  return (
  <Router>
    <div className="App">
    <div>

      <nav>
        <Navbars /> 
      </nav>

      <div>
        <Switch>
          <Route path="/About">
            <About />
          </Route>
          <Route path="/Projects">
            <Projects />
          </Route>
          <Route  path={Contact}>
            <Contact />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>

        <footer>
          <Footer />
        </footer>
    </div>
  </div>
</Router>
  );
}

export default App;
